package leetcode.contest.week281;

import java.util.*;

public class Test6014_构造限制重复的字符串 {

    public static void main(String[] args) {
        System.out.println(new Solution().repeatLimitedString("aababab", 2));
        System.out.println(new Solution().repeatLimitedString("cczazcc", 3));
        System.out.println(new Solution().repeatLimitedString("aaaazzzzzzfff", 55));
        System.out.println(new Solution().repeatLimitedString("",
                49545));
    }

    static class Solution {
        public String repeatLimitedString(String s, int repeatLimit) {
            // 统计出现次数
            Map<Character, Integer> map = new TreeMap<>((c1, c2) -> -Character.compare(c1, c2));
            for (char c : s.toCharArray()) {
                map.put(c, map.getOrDefault(c, 0) + 1);
            }
            // 递归找最大字典序
            StringBuilder sb = new StringBuilder();
            Stack<StringBuilder> stack = new Stack<>();
            stack.add(sb);
            char suffixRepeatChar = ' ';
            int suffixRepeatCnt = 0;
            while (!stack.isEmpty()) {
                StringBuilder currentStr = stack.pop();
                boolean canGoNext = false;
                for (char c : new ArrayList<>(map.keySet())) {
                    if (canGoNext) {
                        break;
                    }
                    if (map.get(c) > 0) {
                        if (c != suffixRepeatChar || suffixRepeatCnt < repeatLimit) {
                            if (c != suffixRepeatChar) {
                                suffixRepeatChar = c;
                                suffixRepeatCnt = 1;
                            } else {
                                suffixRepeatCnt++;
                            }
                            map.put(c, map.get(c) - 1);
                            if (map.get(c) == 0) {
                                map.remove(c);
                            }
                            stack.push(currentStr.append(c));
                            canGoNext = true;
                        }
                    }
                }
            }
            return sb.toString();
        }
    }

}
